import React from 'react';


export  class Eview extends React.Component<any> {
    render(){
        return(
            <>
            <div key={Math.floor((Math.random() * 3220) + 1)} className="col">
            <span key={Math.floor((Math.random() * 3220) + 1)} >id:  {this.props.id}</span>  
          <span key={Math.floor((Math.random() * 3220) + 1)} >username:  {this.props.username}</span>  
          <span key={Math.floor((Math.random() * 3220) + 1)} >password:  {this.props.pass}</span>  
          <span key={Math.floor((Math.random() * 3220) + 1)} >firstname: {this.props.firstname}</span>  
          <span key={Math.floor((Math.random() * 3220) + 1)} >lastname: {this.props.lastname}</span>  
          <span key={Math.floor((Math.random() * 3220) + 1)} >email: {this.props.email}</span>  
          <span key={Math.floor((Math.random() * 3220) + 1)} >role: {this.props.role}</span>  
          </div>
            </>
        )
    }
}
